import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Header from '../components/Header';
import EventCard from '../components/EventCard';
import './EventsPage.css';

const EventsPage = () => {
  const [events, setEvents] = useState([]);
  const [filters, setFilters] = useState({
    date: '',
    location: 'Mumbai',
    category: 'all',
    priceRange: [0, 5000],
  });

  // Mock API data with verified images
  useEffect(() => {
    const mockEvents = [
      {
        id: "coldplay-2025",
        type: "concert",
        title: "Coldplay: Music of the Spheres",
        date: "2025-04-15",
        time: "7:30 PM",
        price: 3500,
        location: "Mumbai",
        language: "English",
        genre: "Rock",
        poster: "https://images.unsplash.com/photo-1470229722913-7c0e2dbbafd3?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=800",
        details: {
          artists: ["Coldplay"],
          sponsors: ["Coca-Cola", "Visa"],
          duration: "2h 30m",
          venue: "DY Patil Stadium",
        },
      },
      {
        id: "avengers-endgame",
        type: "movie",
        title: "Avengers: Endgame",
        date: "2025-05-01",
        time: "6:00 PM",
        price: 300,
        location: "Mumbai",
        language: "Hindi",
        genre: "Action",
        poster: "https://images.unsplash.com/photo-1552820728-8b83bb6b773f?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=800",
        details: {
          cast: ["Robert Downey Jr.", "Chris Evans"],
          director: "Russo Brothers",
          duration: "3h 1m",
          theater: "PVR Cinemas",
        },
      },
    ];
    setEvents(mockEvents);
  }, []);

  // Filtering logic
  const filteredEvents = events.filter(event => {
    const matchesDate = !filters.date || event.date === filters.date;
    const matchesLocation = event.location === filters.location;
    const matchesCategory = filters.category === 'all' || event.type === filters.category;
    const matchesPrice = event.price >= filters.priceRange[0] && event.price <= filters.priceRange[1];

    return matchesDate && matchesLocation && matchesCategory && matchesPrice;
  });

  return (
    <div className="events-page">
      <Header />

      <div className="filters-container">
        <div className="filter-group">
          <label>Date</label>
          <input
            type="date"
            value={filters.date}
            onChange={(e) => setFilters({ ...filters, date: e.target.value })}
          />
        </div>

        <div className="filter-group">
          <label>Location</label>
          <select
            value={filters.location}
            onChange={(e) => setFilters({ ...filters, location: e.target.value })}
          >
            <option value="Mumbai">Mumbai</option>
            <option value="Delhi">Delhi</option>
            <option value="Bengaluru">Bengaluru</option>
          </select>
        </div>

        <div className="filter-group">
          <label>Category</label>
          <select
            value={filters.category}
            onChange={(e) => setFilters({ ...filters, category: e.target.value })}
          >
            <option value="all">All Events</option>
            <option value="concert">Concerts</option>
            <option value="movie">Movies</option>
          </select>
        </div>

        <div className="filter-group">
          <label>Price Range</label>
          <input
            type="range"
            min="0"
            max="5000"
            value={filters.priceRange[1]}
            onChange={(e) => setFilters({ ...filters, priceRange: [0, e.target.value] })}
          />
          <div className="price-range">₹0 - ₹{filters.priceRange[1]}</div>
        </div>
      </div>

      <div className="events-grid">
        {filteredEvents.map(event => (
          <EventCard key={event.id} event={event} />
        ))}
      </div>
    </div>
  );
};

export default EventsPage;
